const carModel={el:"#app",data:()=>({report:{},rto:void 0,service:void 0,regn:""}),created(){},mounted(){},computed:{},methods:{fetchReport(){this.regn.length<13||fetch("/api/report/"+this.regn).then((e=>e.json())).then((e=>{this.report=e,this.rto=JSON.parse(e.rtoDetails).data,this.service=JSON.parse(e.serviceDetails).data.result}))},regnUpd(e){var t=e.target.value.replaceAll("-",""),r=["","","",""];r[0]=t.substring(0,2).toUpperCase(),t.length>2&&(r[1]=t.substring(2,4)),t.length>4&&(r[2]=t.substring(4,6).toUpperCase()),t.length>6&&(r[3]=t.substring(6,10)),t=r.filter((e=>e.length>0)).join("-"),e.target.value=t}}};
